import { Button, ButtonGroup, Grid } from "@mui/material";
import AccountCircleOutlinedIcon from "@mui/icons-material/AccountCircleOutlined";

export default function Header() {
  return (
    <Grid>
      <div
        style={{
          backgroundColor: "#0D1C39",
          backgroundImage:`url(hbg.jpeg)`,backgroundRepeat:"no-repeat"
        }}
      >
        <div style={{display: "flex", justifyContent: "space-between",}}>

          <div style={{ display: "flex" ,justifyContent:"space-between"}}>
            <p style={{color:"white"}}>Home-</p>
            <p style={{color:"white"}}>Listings-</p>
            <p style={{color:"white"}}>Members-</p>
            <p style={{color:"white"}}>Blogs-</p>
            <p style={{color:"white"}}>Pages-</p>
          </div>
          <div style={{ display: "flex" }}>
            <AccountCircleOutlinedIcon st />
            <p style={{color:"white"}}>Login/Register</p>
          </div>
          <div>
            <Button style={{ border: "1px solid white", borderRadius:"5%",color:"white" }}>
              Add Property
            </Button>
          </div>
        </div>
      </div>
    </Grid>
  );
}
